import React from 'react';

const FiltradoCanciones = ({ setFiltro }) => {
    const handleChange = (event) => {
        setFiltro(event.target.value);
    };

    return (
        <div>
            <input 
                type="text" 
                placeholder="Filtrar por artista..." 
                onChange={handleChange}
            />
        </div>
    );
};

export default FiltradoCanciones;
